"223768":{"id":"223768","name":"A História de Brooke Shields","slug":"a-historia-de-brooke-shields","original_title":"Pretty Baby: Brooke Shields","overview":"Acompanhe a transformação da atriz, modelo e ícone Brooke Shields de jovem sexualizada a mulher empoderada. Sua história mostra a realidade de uma sociedade que reduz mulheres e meninas a objetos e mostra os perigos, a força e a alegria do que significa ganhar liberdade e falar com uma voz autêntica.","first_air_date":"2023-04-03","episode_run_time":0,"vote_average":7.2,"number_of_seasons":1,"number_of_episodes":2,"created_by":[],"production_companies":["BedBy8","Drifting Cloud Productions","Matador Content","ABC News Studios","George Stephanopoulos Productions"],"genres":["Documentário"],"certification":"18","backdrop_path":"https://image.tmdb.org/t/p/original/dTsSD3ww6PNfkiX4Fo7wdSJKaSc.jpg","poster_path":"https://image.tmdb.org/t/p/original/o8kUdljrV17rfHttSawH879L85N.jpg","cast":["Brooke Shields","Scaachi Koul","Isobel Coleman","Meenakshi Durham","Gavin de Becker"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/o8kUdljrV17rfHttSawH879L85N.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/o8kUdljrV17rfHttSawH879L85N.jpg","air_date":"2023-04-03","episode_count":2,"overview":"N/A","vote_average":8.3,"episodes":{"1":{"name":"Parte I","overview":"De jovem sexualizada a graduada em Princeton, Brooke navega sua infância extraordinária e seu relacionamento complexo com Teri, sua mãe e empresária. O início da carreira de Brooke, definido por uma sexualidade que ela não reivindicava nem compreendia, a catapulta para o estrelato global e a força a navegar uma cultura tóxica que quer vendê-la para o público em massa. Brooke desafia todos os estereótipos indo para a faculdade.","air_date":"2023-04-03","runtime":69,"still_path":"https://image.tmdb.org/t/p/original/432I1P5VtiH40rsIzhFvcjqPa6S.jpg","vote_average":9.5},"2":{"name":"Parte II","overview":"Ao retornar à indústria do entretenimento como adulta, a confiança de Brooke é abalada pela dura realidade da rejeição e pelas ações complicadas das pessoas mais próximas a ela. Ela só consegue encontrar sua identidade e voz quando começa a confiar em si e em seus instintos. Mas quando ela tenta falar, uma cultura tóxica faz de tudo para calá-la.","air_date":"2023-04-03","runtime":71,"still_path":"https://image.tmdb.org/t/p/original/rzPbpymbaR4DWcP3ODf1yJ33AXj.jpg","vote_average":7}}}}},
