"116986":{"id":"116986","name":"O Arsenal dos Espiões","slug":"o-arsenal-dos-espioes","original_title":"Spycraft","overview":"Espionagem é coisa séria. Ao longo da história, as tecnologias e os dispositivos criados para a atividade se tornaram tão importantes quanto os próprios espiões.","first_air_date":"2021-01-20","episode_run_time":35,"vote_average":6.9,"number_of_seasons":1,"number_of_episodes":8,"created_by":[],"production_companies":[],"genres":["Documentário"],"certification":"18","backdrop_path":"https://image.tmdb.org/t/p/original/5gZB8UeTTCZN3GzpkkqHZIPO9Ve.jpg","poster_path":"https://image.tmdb.org/t/p/original/qE58fDadsNnGJzRrP3T1lefKrsK.jpg","cast":["Dylan Berry"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/3JJMgQ09UpZKzfsbjHatqhSmPJc.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/3JJMgQ09UpZKzfsbjHatqhSmPJc.jpg","air_date":"2021-01-20","episode_count":8,"overview":"N/A","vote_average":5.9,"episodes":{"1":{"name":"Vigilância de última geração","overview":"Ouvir é essencial para conseguir informações no mundo da espionagem, e o desenvolvimento de dispositivos de escuta exige soluções criativas e engenhosas.","air_date":"2021-01-20","runtime":29,"still_path":"https://image.tmdb.org/t/p/original/dGOYay6k6vyv4wwDcjjEI9oxkjV.jpg","vote_average":6.5},"2":{"name":"Venenos mortais","overview":"Em algumas missões secretas, o objetivo não é obter informações, e sim matar. Conheça algumas das toxinas letais usadas contra potenciais inimigos.","air_date":"2021-01-20","runtime":31,"still_path":"https://image.tmdb.org/t/p/original/7MhZ2C46hCj5f4YYWZ4cMbpRQhM.jpg","vote_average":5.8},"3":{"name":"A arma do sexo","overview":"Desde o início da espionagem até os dias de hoje, o sexo e a sedução são armas poderosas para persuadir e chantagear.","air_date":"2021-01-20","runtime":33,"still_path":"https://image.tmdb.org/t/p/original/fm0MNh910hQfZKJwZhaQ6hCBG1w.jpg","vote_average":6},"4":{"name":"Coleta clandestina","overview":"Os métodos para obter informações confidenciais se tornam cada vez mais avançados à medida que os dispositivos ficam menores.","air_date":"2021-01-20","runtime":36,"still_path":"https://image.tmdb.org/t/p/original/8WOaa9nup5N4575Nf5fOM5JIMmA.jpg","vote_average":6},"5":{"name":"Comunicação codificada","overview":"Dos tradicionais \"pontos de troca\" às modernas ferramentas digitais, conheça alguns dos métodos utilizados pelos agentes para receber informações das fontes.","air_date":"2021-01-20","runtime":33,"still_path":"https://image.tmdb.org/t/p/original/6xQ6bCxDDBvHwQmmXzaaJA3bfsY.jpg","vote_average":6},"6":{"name":"Operações especiais e sabotagem","overview":"Operações especiais exigem os melhores agentes. Mas algumas das missões mais famosas da história moderna também contaram com tecnologia de ponta.","air_date":"2021-01-20","runtime":30,"still_path":"https://image.tmdb.org/t/p/original/g5a3fKYsROvWCF7eOvy07GRPj4N.jpg","vote_average":5.8},"7":{"name":"Desvendando códigos","overview":"A criptografia é uma ferramenta crucial para proteger as informações. Mas algumas mentes brilhantes conseguem desvendar códigos supostamente indecifráveis.","air_date":"2021-01-20","runtime":36,"still_path":"https://image.tmdb.org/t/p/original/nJrGdF4PJnyRb3s9S9mn23jLYX5.jpg","vote_average":5.8},"8":{"name":"Recrutando o espião perfeito","overview":"O que faz alguém espionar o próprio país? As motivações podem variar, mas geralmente se enquadram em quatro categorias, como mostram alguns casos famosos.","air_date":"2021-01-20","runtime":38,"still_path":"https://image.tmdb.org/t/p/original/kjolcJPFXiLqtJXb4fVosop6sba.jpg","vote_average":5.8}}}}},
"196583":{"id":"196583","name":"A Grande Jogada: Além das Quadras","slug":"a-grande-jogada-alem-das-quadras","original_title":"The Long Game: Bigger Than Basketball","overview":"Makur Maker era uma promessa cinco estrelas da NBA que ia para o Draft – até que um desvio inesperado o levou à Universidade Howard. Esta série documental inspiradora segue a jornada de Makur e sua determinação em reescrever sua história com a ajuda de sua família.","first_air_date":"2022-04-22","episode_run_time":0,"vote_average":6,"number_of_seasons":1,"number_of_episodes":5,"created_by":[],"production_companies":["Sony Pictures Television","Boardwalk Pictures","Exhibit A"],"genres":["Documentário"],"certification":"12","backdrop_path":"https://image.tmdb.org/t/p/original/zeU4euz4wYAXoUZVlxhyLxWaSf8.jpg","poster_path":"https://image.tmdb.org/t/p/original/44TcEBfuOgBcrbZdHVLKvCYtABA.jpg","cast":["Makur Maker"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/44TcEBfuOgBcrbZdHVLKvCYtABA.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/44TcEBfuOgBcrbZdHVLKvCYtABA.jpg","air_date":"2022-04-22","episode_count":5,"overview":"N/A","vote_average":0,"episodes":{"1":{"name":"Figurão","overview":"Quando o caminho de Makur para a NBA é prejudicado pela COVID, ele se matricula na Universidade Howard para enviar uma mensagem poderosa.","air_date":"2022-04-22","runtime":51,"still_path":"https://image.tmdb.org/t/p/original/yujCu0cXBmzgv2eiI3B2Mry3FHe.jpg","vote_average":0},"2":{"name":"Curso Intensivo","overview":"Makur e seu técnico na Howard entram em conflito, além disso, uma lesão e a pandemia ameaçam deixar seus planos de lado. Uma reviravolta no Pistons surpreende Thon, primo de Makur.","air_date":"2022-04-22","runtime":53,"still_path":"https://image.tmdb.org/t/p/original/4w1XTdIsOwyuAlVT731Jgi7styM.jpg","vote_average":0},"3":{"name":"Aprendizado","overview":"Após alguns poucos jogos na temporada, Howard Bison toma uma decisão difícil. Em uma virada surpreendente, Thon volta para a NBA.","air_date":"2022-04-22","runtime":48,"still_path":"https://image.tmdb.org/t/p/original/q4ddOngsDmafswTz7HBjVwEuP4g.jpg","vote_average":0},"4":{"name":"Tiro no Escuro","overview":"Makur se reúne com o técnico Edward, seu guardião legal, que deve lidar com o estresse de uma questão médica familiar enquanto prepara Makur para o Draft da NBA.","air_date":"2022-04-22","runtime":49,"still_path":"https://image.tmdb.org/t/p/original/o7SUpi8h9wr8ROI0XDJcf47zNhB.jpg","vote_average":0},"5":{"name":"Momento Crítico","overview":"As esperanças são grandes quando Makur participa do Draft Combine da NBA e a família Maker dá as boas-vindas a um novo membro.","air_date":"2022-04-22","runtime":51,"still_path":"https://image.tmdb.org/t/p/original/cumencVubhNQigPI39l9hcVtTlB.jpg","vote_average":0}}}}},
